import React, { Component} from 'react';
import '../App.css';
import {Link} from  'react-router-dom';
import {Slider} from '@material-ui/core';
import { withStyles, makeStyles } from '@material-ui/core/styles';
import {retrieveUserPriceOrders} from '../actions/actions';
import { Button, Navbar, Nav, NavItem, NavDropdown, MenuItem } from 'react-bootstrap';
import Chart from "react-apexcharts";
class PriceGraph extends Component {
    constructor(props){
        super(props);
        // This binding is necessary to make `this` work in the callback
        this.state = {
            options: {
                chart: {
                  id: "price-line-chart"
                },
                xaxis: {
                  categories: []
                },
                    colors: ['#00FF00','#00FF00','#00FF00']

              },
              markers: {
                colors: ['#00FF00', '#00FF00', '#00FF00']
             },
              series: [
                {
                  name: "series-prices",
                  data: [],

                }
              ],

              data: [],
            }
        this.name = "";
      }
      componentDidMount(){
        this.fetchUserPriceOrders();
    }
    fetchUserPriceOrders = () => {
        const {name} = this.props.location.state;
        console.log(name);

        retrieveUserPriceOrders({data: name}).then(res =>{ 
            console.log(res);
            let price_results = res.data;
            let price_values = [];
            for(let i = 0; i < price_results.length; i++){
                price_values.push(price_results[i].totalprice);
            }
            this.setState({
                series: [{
                name:"series-prices", 
                data: price_values
                }] 
             });
            console.log(res);
        }).catch(err => {
            alert('Failed to fetch Your Orders! '+err);
        });
      }

    gotoHome = (event) => {
        event.preventDefault();
        const {name} = this.props.location.state;
        this.props.history.push("/home",{
            name:name
        }); 
    }
   gotoCustomerOrders = (event) => {
    event.preventDefault();
    const {name} = this.props.location.state;
    this.props.history.push("/customerorders",{
        name:name
    }); 
  }
  Logout = (event) => {
    event.preventDefault();
    const {name} = this.props.location.state;
    this.props.history.push("/",{
        name:name
    });
  }

    render() {
        const {name} = this.props.location.state;
        this.name = name;
      return (
        <div className="container">
             <Navbar fixed="top" className="color-nav" collapseOnSelect expand="lg" variant="dark" >
          <Navbar.Brand onClick={this.gotoHome}>
      <img
        alt=""
        src="/greengamingpc.png"
        width="25"
        height="33"
        className="d-inline-block align-top"
      />{' '}
     NDXHardware™
    </Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link onClick={this.gotoCustomerOrders}>View Orders</Nav.Link>
    </Nav>
    <Nav>
      <Nav.Link onClick={this.Logout}>
        Logout 
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
                <br></br> 
              <br></br>
              <br></br>
            <div className="col-lg-12 m-auto">
            <div className="card card-body">
            <br></br>
            <br></br>
            <h2 class="text-center mb-3" className="Label">Price Summary of All Orders
            </h2>
            <br></br>
            <br></br>
            <br></br>
            <div className="form-group">
            <Chart
             options={this.state.options}
             series={this.state.series}
             type="line"
             width="1000"
            />

            <h5 class="text-center mb-3" className="Label"><b>
           Your Investments For Each PC Configuration </b> 
            </h5>  

            <br></br>
            </div>
                <br></br>
            <br></br>
            </div>
        </div>        
          </div>
      );
    }
  }

  export default PriceGraph;
